import chicaCompu from '../../../imagenes/chicaCompu.jpeg'

export default class ImagenFondo extends Component {
    static navigationOptions = {
      header: null
    }
    render() {
        return (
            <img
                source={require(chicaCompu)}
                style={styles.container}>
                <Text>
                  This text will be on top of the image
                </Text>
            </img>
        );
    }


    styles = StyleSheet.create({
        container: {
            flex: 1,
            width: undefined,
            height: undefined,
            justifyContent: 'center',
            alignItems: 'center',
          },
    });
}
